import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const AddQuestion = () => {
    const [question, setQuestion] = useState('');
    const [options, setOptions] = useState(['', '', '']);
    const [correctOption, setCorrectOption] = useState('');
    const [mark, setMark] = useState('');
    const [negativeMark, setNegativeMark] = useState('');
    const [loading, setLoading] = useState(false);
    const [successMessage, setSuccessMessage] = useState('');
    const [error, setError] = useState('');

    const navigate = useNavigate();

    // Handle option changes
    const handleOptionChange = (index, value) => {
        const newOptions = [...options];
        newOptions[index] = value;
        setOptions(newOptions);
    };

    // Add new option field
    const addOption = () => {
        setOptions([...options, '']);
    };

    // Submit question data
    const handleSubmit = async () => {
        setLoading(true);
        try {
            const response = await axios.post('http://localhost:8000/staff/addquestion/', {
                question,
                options,
                correctOption,
                mark,
                negativeMark,
            });

            // Save the data in sessionStorage
            sessionStorage.setItem('questionData', JSON.stringify({
                question,
                options,
                correctOption,
                mark,
                negativeMark,
            }));

            if (response.status === 200) {
                setSuccessMessage('Question added successfully!');
                setError(null); // Clear any previous error
            }
        } catch (err) {
            setError(err.response?.data?.error || 'Failed to add question. Please try again.');
            setSuccessMessage('');
        } finally {
            setLoading(false);
        }
    };

    // Reset form fields for adding a new question
    const handleNext = () => {
        setQuestion('');
        setOptions(['', '', '']);
        setCorrectOption('');
        setMark('');
        setNegativeMark('');
        setSuccessMessage(''); // Clear success message
        setError(''); // Clear error message
    };

    return (
        <div>
            <h1>Add Question</h1>
            <div>
                <label>Question*</label>
                <textarea value={question} onChange={(e) => setQuestion(e.target.value)} />
            </div>
            <div>
                <label>Options*</label>
                {options.map((option, index) => (
                    <input
                        key={index}
                        value={option}
                        onChange={(e) => handleOptionChange(index, e.target.value)}
                    />
                ))}
                <button onClick={addOption}>Add Option</button>
            </div>
            <div>
                <label>Correct Option*</label>
                <input
                    type="text"
                    value={correctOption}
                    onChange={(e) => setCorrectOption(e.target.value)}
                />
            </div>
            <div>
                <label>Mark*</label>
                <input type="text" value={mark} onChange={(e) => setMark(e.target.value)} />
            </div>
            <div>
                <label>Negative Mark*</label>
                <input
                    type="text"
                    value={negativeMark}
                    onChange={(e) => setNegativeMark(e.target.value)}
                />
            </div>
            {loading && <p>Submitting...</p>}
            {successMessage && <p>{successMessage}</p>}
            {error && <p>{error}</p>}
            <button onClick={handleSubmit}>Submit</button>
            <button onClick={handleNext}>Next</button>
            <button onClick={() => navigate(-1)}>Back</button>
        </div>
    );
};

export default AddQuestion;
